import React from 'react';

export default function About() {
  return (
    <div>

      <h2>About Me</h2>
      <h3>Who is Tina?</h3>

      <h2>Toolbox</h2>
      <h3> tools & skills </h3>
      <p> Here are some of the tools I use and things I can do</p>
    </div>
  );
}
